import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    const name = 'Daniel Andersson hej hej';
    const loading = true;

    return (
      <div className='App'>
        <h1>Hello {name}</h1>
      </div>
    );
  }
}
export default App;
